import React, {useState} from 'react';
import IndivDoc from '../../components/IndivDoc/IndivDoc';
import Aux from '../../hoc/Auxiliary/Auxiliary';

const DoctorList = ()=> {
    
    const [docInfo, setDocInfo] = useState(
        {
            docId: 1,
            docImg: './assets/images/docImg/doc-1.png',
            name: 'Dr. Samra Sadaf',
            specialization: ['Dermatologist', 'Cosmetologist'],
            education: [{ 
                degree: 'M.B.B.S',
                uniName: 'Sharif Medical & Dental College',
                countryName: 'Pakistan',
                yearOfGrad: '2015'
            }, 
            { 
                degree: 'M.C.P.S (Dermatology)' ,
                uniName: ' Gujranwala Medical College',
                countryName: 'Pakistan',
                yearOfGrad: '2021'
            }
            ],
            experience: '5 Years',
            satisfiedPatients: .91,
            noOfReviews: 54,
            waitTime: 15

        }
    );
    
    return(
         <IndivDoc />
        

    );
};

export default DoctorList;
